contract SNNToken is ERC20 {
    using SafeMath for uint256;

    mapping(address => bool) internal _isExcludedFee;
    mapping(address => bool) public _isBlacklist;
    mapping(address => bool) public _uniswapV2Pair;

    // Distribution scheme
    address public marketAddress = 0x5e2BD9530f75257dcbB2D2f3593bD0c675bc2538;
    address public lpPoolAddress;
    address public fluidityAddress = 0xebE94C1e7a63AE6EE1FAc8f931aB6fFADd074962;

    // Liquify Pool
    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    address public USDT = 0x55d398326f99059fF775485246999027B3197955;

    // Power switch
    bool public tradingEnabled;
    bool public transferEnabled;
    bool public transferTaxesEnabled;

    // Trading Restriction
    uint256 public antiBotBlocks;
    uint256 public startTradingBlock;
    

    // Taxes fees
    uint256 public fluidityTaxes = 0;
    uint256 public marketTaxes = 8;
    uint256 public liquifyTaxes = 0;
    uint256 public totalTaxes = (marketTaxes + liquifyTaxes + fluidityTaxes);


    bool inSwapAndLiquify;
    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }


    constructor() ERC20("Space Nation", "SNN") {
        address _self = address(this);
        uint256 _totalSupply = 10000000 * 10**decimals();
        address router = 0x10ED43C718714eb63d5aA57B78B54704E256024E; // Mainnet

        // Config Test Address
        // ecologyAddress = _self;
        // liquifyAddress = msg.sender;
        // router = 0x9Ac64Cc6e4415144C455BD8E4837Fea55603e5c3; // Testnet   
        // USDT = 0x147659e055E0D235DaedE905c77c17e8D5692a2D;   // Testnet
        // uniswapV2Pair = 0xdD870fA1b7C4700F2BD7f44238821C26f7392148;
        

        // get Uniswap v2 router 
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(router);
        // Create a uniswap pair for this new token
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(_self, USDT);
        // set the rest of the contract variables
        uniswapV2Router = _uniswapV2Router;
        lpPoolAddress = uniswapV2Pair;
        _allowances[_self][uniswapV2Pair] = _totalSupply;
        setUniswapV2Pair(uniswapV2Pair, 1);


        // Configure free address
        _isExcludedFee[msg.sender] = true;
        _isExcludedFee[_self] = true;
        _isExcludedFee[marketAddress] = true;
        _isExcludedFee[fluidityAddress] = true;

 
        // Token allocation scheme
        _mint(msg.sender, _totalSupply);
    }

    //to recieve ETH from uniswapV2Router when swaping
    receive() external payable {}
    

    function setExcludeFromFee(address account) public onlyOwner {
        _isExcludedFee[account] = true;
    }

    function setIncludeInFee(address account) public onlyOwner {
        _isExcludedFee[account] = false;
    }

    function isExcludedFromFee(address account) public view returns (bool) {
        return _isExcludedFee[account];
    }

    function setTransferEnabled(uint8 _enabled) public onlyOwner {
        transferEnabled = _enabled == 1;
    }

    function setTradingEnabled(uint8 _enabled) public onlyOwner {
        tradingEnabled = _enabled == 1;
        startTradingBlock = block.number;
    }

    function setTransferTaxesEnabled(uint8 _enabled) public onlyOwner {
        transferTaxesEnabled = _enabled == 0;
    }

    function setAntiBotBlocks(uint256 blocks) public onlyOwner {
        antiBotBlocks = blocks;
        startTradingBlock = block.number;
    }

    function setBulkBlacklist(address[] memory bots, uint8 _enabled) external onlyOwner {
        for(uint256 i; i < bots.length; i++){
            _isBlacklist[bots[i]] = _enabled == 1;
        }
    }

    function setUniswapV2Pair(address pair, uint8 _enabled) public onlyOwner {
        _uniswapV2Pair[pair] = _enabled == 1;
    }

    function setTaxes(uint256 market, uint256 liquify, uint256 fluidity) public onlyOwner {
        marketTaxes = market;
        liquifyTaxes = liquify;
        fluidityTaxes = fluidity;
        totalTaxes = market + liquify + fluidity;
    }

    function setLPPoolAddress(address _lp) public onlyOwner {
        lpPoolAddress = _lp;
    }

    function setMarketAddress(address _market) public onlyOwner {
        marketAddress = _market;
    }

    function setFluidityAddress(address _fluidity) public onlyOwner {
        setIncludeInFee(fluidityAddress);
        setExcludeFromFee(_fluidity);
        fluidityAddress = _fluidity;
    }


    function _transfer(address from, address to, uint256 amount) internal override {
        require(transferEnabled, "Transfer is not enabled");
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(!_isBlacklist[from] && !_isBlacklist[to] , "is bot address ");
        require(amount > 0, "Transfer amount must be greater than zero");

        if (amount == 0) {
            super._transfer(from, to, amount);
            return;
        }

        // i ndicates if fee should be deducted from transfer
        bool takeFee = false;
        
        // if any account belongs to _isExcludedFromFee account then remove the fee
        if (_isExcludedFee[from] || _isExcludedFee[to]) {
            takeFee = false;
        } else if (isContract(from) || isContract(to) || _uniswapV2Pair[from] || _uniswapV2Pair[to]) {
            // buy, seller limit
            require(tradingEnabled, "Transaction not activated.");
            
            if (_uniswapV2Pair[to]) 
                takeFee = true;

            if (_uniswapV2Pair[from]) {

                if (antiBotBlocks > 0 && block.number <= (startTradingBlock + antiBotBlocks)) {
                    _isBlacklist[to] = true;
                }
            }

        } else {
            takeFee = transferTaxesEnabled;
        }


        // transfer amount, it will take tax, burn, liquidity fee
        if (takeFee) {
            _tokenTransfer(from, to, amount, takeFee);
        } else {
            super._transfer(from, to, amount);
        }

    }

    //this method is responsible for taking all fee, if takeFee is true
    function _tokenTransfer(address sender, address recipient, uint256 amount, bool takeFee) private {

        // Deduct sender
        uint256 rAmount = amount;
        uint256 recipientAmount = amount;
        _balances[sender] = _balances[sender].sub(amount);

        if (takeFee) {
            _takeFee(sender, lpPoolAddress, amount, liquifyTaxes);
            _takeFee(sender, marketAddress, amount, marketTaxes);
            _takeFee(sender, fluidityAddress, amount, fluidityTaxes);
            recipientAmount = rAmount.div(100).mul(100 - totalTaxes);
        }

        // receive
        _balances[recipient] = _balances[recipient].add(recipientAmount);
        emit Transfer(sender, recipient, recipientAmount);
    }

    function _takeFee(address sender, address recipient, uint256 amount, uint percent) private {
        if (percent == 0) return;
        if (recipient == address(0)) recipient = burnAddress;
        uint256 rAmount = amount.mul(percent).div(100);
        _balances[recipient] = _balances[recipient].add(rAmount);
        emit Transfer(sender, recipient, rAmount);
    }

}
